        _previousDevFee       = _devFee;
        _previousRewFee       = _rewFee;
        _previousMaxiFee      = _maxiFee;
        _previousLiquidityFee = _liquidityFee;

        _taxFee  = 0;
        _burnFee = 0;
        _devFee  = 0;
        _rewFee  = 0;
        _maxiFee = 0;
        _liquidityFee = 0;
    }

    function restoreAllFee() private {
